import React from "react";
import NewEventForm from './NewEventForm'
import EventsList from './EventsList'
import EventDetail from './EventDetail'
import { connect } from "react-redux";
import { fetchEvents } from "../redux/actions/index";


class EventsPage extends React.Component {
  componentDidMount() {
      this.props.fetchEvents();
    }

  handleClick= (e) => {
     e.preventDefault();
     console.log("Create NEW Event Form")
   }

  render(){
    return (
      <div>
        <NewEventForm />

        <Switch></Switch>
          <Route
                  path="/paintings/:paintingId"
                  render={data => {
                    return (
                      <PaintingDetail paintingId={data.match.params.paintingId} />
                    );
                  }}
                />
        <EventsList />
        <EventDetail eventId={data.match.params.eventId} />
      </div>
    )}
};

export default connect(
  null,
  { fetchEvents }
)(EventsPage);
